description:
Sometimes you have to give back to the fans that give you the most. I had a fan contact me asking if I would help him lose his virginity. As strange as the request was, I thought I could genuinely help him gain some confidence and learn some tips for the next time he encounters a a form of the female kind. I surprisingly enjoyed his air of innocence and naivety regarding sex, it was an experience I'd be open to doing again, with another fan who truly needs the help.
